import React from "react";

function AddTask() {
  return (
    <section className="addtask">
      <form>
        <input
          type="text"
          name="task"
          id="task"
          placeholder="Task Name"
          autoComplete="off"
        />
        <button type="submit">Add Task</button>
      </form>
    </section>
  );
}

export default AddTask;
